import React from 'react'
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Container from "@mui/material/Container";
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import { useNavigate } from "react-router-dom";
import './Home.css'

export default function Header() {
    const navegate = useNavigate();
    const logout = () =>{
        window.confirm("Are you shure want to logout");
        if(window.confirm === ok ){
        navegate("/")
        }
    }
  return (
    <div>
        <AppBar position='static' style={{ backgroundColor:"#80cbc4"}}>
        <Container maxWidth="90%">
          <Toolbar disableGutters>
            <img
              src="https://vyaparwebsiteimages.vypcdn.in/logo1.svg"
              alt='...'
              style={{ width: "20%" }}
            />

            <Stack direction="row" spacing={2}>
              <Button href="/Home"  style={{color:"black", fontSize:"25px"}}>Home</Button>
              <Button href="/UserDetails"  style={{color:"black", fontSize:"25px" }}>Users</Button>
              <Button href="/BillingDetails"  style={{color:"black", fontSize:"25px" }}>Bill Details</Button>
              <Button href="/invoice"  style={{color:"black", fontSize:"25px" }}>Invoice</Button>
              <Button href="/MainContent"  style={{color:"black", fontSize:"25px" }}>Create Invoice</Button>
              <Button href=""  style={{color:"black", fontSize:"25px" }}>About</Button>
            </Stack>
            <Button variant="contained" size="large" style={{marginLeft:"14%"}} onClick={logout}>
          Logout
        </Button>
          </Toolbar>
        </Container>
      </AppBar>
    </div>
  )
}
